  false,\n\t\"url\": null,\n\t\"notes\": \"This paper reports techniques developed
  to live trap and handle brown bears on the Kodiak National Wildlife Refuge. The
  brown bears (Ursus middendorffi) on the Kodiak National Wildlife Refuge, Kodiak
  Island, Alaska have been subject to heavy hunting pressure for the past decade.
  The refuge still produces the world's largest bears but in order to continue maximum
  trophy production, more information is required on movements, growth rates, productivity,
  survival and other life history data. Presented at the 12th Alaska Science Conference,
  University of Alaska, College, August 31, 1961.\",\n\t\"license_title\": \"License
